<!DOCTYPE html>
<html>
    <head>
        <title>Kar√°csonyfa</title>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1">
        <style>
            html, body {
                margin: 0px;
                padding: 0px;
                overflow: hidden;
                background-color: #080744;
            }

            svg {
                opacity: 0;
            }

            svg.show {
                opacity: 1;
            }

            #test {
                width: 100px;
                height: 100px;
            }
            
            #logo path {
                opacity: 0;
            }

            #test div {
                position: absolute;
                top: 5px;
                left: 5px;
                width: 50px;
                height: 50px;
                background-color: blue;
                filter: drop-shadow(10px 10px 32px blue);
            }

            circle {
                fill: #C2F6FF;
                transition: fill .7s, filter 3s;
            }
            circle.glow {
                transition: filter 3s;
                filter: drop-shadow(0px 0px 32px #FFF) drop-shadow(0px 0px 24px rgba(255, 255, 255, 0.3));
            }
            circle.n1 {
                fill: #24C4FF;
                transition: fill 1s;
            }
            circle.n2 {
                fill: #FF42A4;
                transition: fill 1s;
            }
            circle.n3 {
                fill: #3CFFD8;
                transition: fill 1s;
            }
            circle.n4 {
                fill: #FFDD80;
                transition: fill 1s;
            }

        </style>
        <script src="anime.min.js"></script>
        <script type="text/javascript">
            const params = new URL(document.location.toString()).searchParams;
            const shares = [
                params.get("k"),
                params.get("p"),
                params.get("t"),
                params.get("s")
            ].map(s => parseInt(s));
            window.onload = () => {
                const tree = document.getElementById("tree");
                const circles = [...tree.querySelectorAll('circle')];
                let start = 0;
                shares.forEach((n, i) => {
                    for (let j = 0; j < n && start + j < circles.length; j++) {
                        const c = circles[start + j];
                        c.setAttribute('data-r', parseInt(c.getAttribute('r')));
                        c.classList.add('glow');
                        c.setAttribute('r', 0);
                        c.classList.add(`n${i+1}`);
                    };
                    start = start + n;
                });


                const timeline = anime.timeline();

                timeline.add(
                    {
                        targets: '#tree path, #tree line, #tree rect',
                        strokeDashoffset: [anime.setDashoffset, 0],
                        easing: 'easeInOutSine',
                        duration: 10000,
                        delay: 1000,
                        loop: false,
                        begin: () => {
                            document.getElementById("tree")
                                .classList.add("show");
                        }
                    },
                    10000
                )
                .add(
                    {
                        targets: '#logo path',
                        opacity: 1,
                        duration: 5000,
                        easing: 'cubicBezier(.5, .05, .1, .3)',
                    }
                )
                .add(
                    {
                        targets: '#tree circle',
                        r: el => el.getAttribute('data-r'),
                        duration: 250,
                        easing: 'cubicBezier(.5, .05, .1, .3)',
                        delay: anime.stagger(250),
                        complete: () => {
                            setTimeout(() => 
                                setInterval(() => {
                                    circles.forEach(c => {
                                        c.classList.remove('n1', 'n2', 'n3', 'n4');
                                        c.classList.add(`n${Math.round(Math.random() * 4) % 4 + 1}`);
                                    })
                                }, 2000)
                            , 10000)
                        }
                    },
                    '+=1000' // time offset
                );
            }
        </script>
    </head>
